import PropTypes from 'prop-types';

const CopyTelegramID = props => {
    return (
        <div>
            <h2 className='text-2xl font-medium text-gray-800 mb-2 xl:mb-7'>Copy Telegram ID</h2>
            <p className='text-gray-700 lg:text-xl mb-3'>Copy your Telegram ID after starting the bot</p>
        </div>
    );
};

CopyTelegramID.propTypes = {};

export default CopyTelegramID;
